html, body, div, span, applet, object, iframe,
h1, h2, h3, h4, h5, h6, p, blockquote, pre,
a, abbr, acronym, address, big, cite, code,
del, dfn, em, img, ins, kbd, q, s, samp,
small, strike, strong, sub, sup, tt, var,
b, u, i, center,
dl, dt, dd, ol, ul, li,
fieldset, form, label, legend,
table, caption, tbody, tfoot, thead, tr, th, td,
article, aside, canvas, details, embed, 
figure, figcaption, footer, header, hgroup, 
menu, nav, output, ruby, section, summary,
time, mark, audio, video {
	margin: 0;
	padding: 0;
	border: 0;
	font-size: 100%;
	font: inherit;
	vertical-align: baseline;
}
/* HTML5 display-role reset for older browsers */
article, aside, details, figcaption, figure, 
footer, header, hgroup, menu, nav, section {
	display: block;
}
body {
	line-height: 1;
}
ol, ul {
	list-style: none;
}
blockquote, q {
	quotes: none;
}
blockquote:before, blockquote:after,
q:before, q:after {
	content: '';
	content: none;
}
table {
	border-collapse: collapse;
	border-spacing: 0;
}

/* CLEARFIX */

.clearfix:before,
.clearfix:after {
    content:"";
    display:table;
}
.clearfix:after {
    clear:both;
}
/* For IE 6/7 (trigger hasLayout) */
.clearfix {
    zoom:1;
}

/* STYLE */

* {
	-webkit-box-sizing: border-box;
	-moz-box-sizing: border-box;
	box-sizing: border-box;
}

body {
	font-family: 'Roboto', sans-serif;
	font-size: 16px;
	line-height: 1.3;
	font-weight: 300;
}

.header {
	border-top: 1px solid #e6e6e6;
	border-bottom: 1px solid #e6e6e6;
	padding: 20px 10px;
}

.inner {
	max-width: 1100px;
	margin: 0 auto;
}

.logo {
	display: block;
	float: left;
}

.logo img {
	display: inline-block;
	vertical-align: middle;
}

.logo img:last-child {
	margin-left: 5px;
}

.navigation {
	font-size: 0;
	margin-left: 65px;
	float: left;
}

.navigation li {
	display: inline-block;
	vertical-align: middle;
	margin: 0 20px;
	line-height: 55px;
	height: 55px;
}

.navigation li a {
	font-size: 14px;
	font-weight: 700;
	color: #7e7e7e;
	text-transform: uppercase;
	letter-spacing: 2px;
	text-decoration: none;
	position: relative;
}

.navigation li a:hover {
	color: #222;
}

.navigation li a:after {
	display: block;
	width: 0;
	position: absolute;
	content: "";
	bottom: -12px;
	left: 50%;
	height: 3px;
	background: #00bdef;
	-webkit-transition: all 200ms;
	-moz-transition: all 200ms;
	transition: all 200ms;
}

.navigation li a:hover:after {
	left: 0;
    width: 100%;
}

.social {
	padding-top: 13.5px;
	float: right;
}

.social a, .footer-follow a {
	display: inline-block;
	width: 28px;
	height: 28px;
	-webkit-border-radius: 50%;
	-moz-border-radius: 50%;
	border-radius: 50%;
	border: 1px solid #00bdef;
	text-align: center;
	position: relative;
	margin-left: 10px;
	-webkit-transition: all 200ms;
	-moz-transition: all 200ms;
	transition: all 200ms;
}

.social a:hover, .footer-follow a:hover {
	background: #00bdef;
}

.social a:hover svg path, .footer-follow a:hover svg path {
	fill: #fff;
	-webkit-transition: all 200ms;
	-moz-transition: all 200ms;
	transition: all 200ms;
}

.social a:first-child, .footer-follow a:first-child {
	margin-left: 0;
}

.fa-search {
	display: block;
	height: 18px;
	width: 16px;
	position: absolute;
	top: 50%;
	left: 50%;
	margin: -9px 0 0 -8px;
}

.fa-instagram {
	display: block;
	height: 18px;
	width: 14px;
	position: absolute;
	top: 50%;
	left: 50%;
	margin: -9px 0 0 -7px;
}

.fa-twitter {
	display: block;
	height: 18px;
	width: 16px;
	position: absolute;
	top: 50%;
	left: 50%;
	margin: -9px 0 0 -8px;
}

.fa-facebook-f {
	display: block;
	height: 18px;
	width: 9px;
	position: absolute;
	top: 50%;
	left: 50%;
	margin: -9px 0 0 -4.5px;
}

.wrapper {
	margin: 35px auto 0;
	padding: 0 20px;
	max-width: 1140px;
}

.bread a {
	color: #1173b4;
	text-decoration: none;
	font-size: 19px;
}

h1 {
	margin-bottom: 10px;
	font-size: 55px;
	line-height: 64px;
}

.meta {
	margin-bottom: 10px;
}

.meta-info {
	float: left;
}

.by {
	color: #0f0f0f;
	margin-bottom: 8px;
	font-size: 19px;
}

.by a {
	text-decoration: none;
	color: #1173b4;
}

.date {
	font-size: 14px;
	color: #0f0f0f;
}

